import React, { Component } from "react";

class ToDoHeader extends React.Component {
  onAddToDo = () => {
    console.log("check1");
    this.props.onAdd("check1");
  };

  render() {
    return (
      <div>
        <button onClick={this.onAddToDo}>Add Todo</button>
      </div>
    );
  }
}

export default ToDoHeader;
